        { L["Lord Jaraxxus"], 633 },
        { L["Faction Champions"], 637 },
        { L["Val'kyr Twins"], 641 },
        { L["Anub'arak"], 645 },
      }
    },
    {
      L["Onyxia's Lair"],
      {
        { L["Onyxia"], 1084 },
      }
    },
    {
      L["Icecrown Citadel"],
      {
        -- The Lower Spire
        { L["Lord Marrowgar"], 845 },
        { L["Lady Deathwhisper"], 846 },
        { L["Gunship Battle"], 847 },
        { L["Deathbringer Saurfang"], 848 },
        -- The Plagueworks
        { L["Festergut"], 849 },
        { L["Rotface"], 850 },
        { L["Professor Putricide"], 851 },
        -- The Crimson Hall
        { L["Blood Prince Council"], 852 },
